function projectsReducer(
  state = {
    projects: [],
  },
  action
) {
  const projects = state.projects;

  switch (action.type) {
    case "ADD_PROJECT":
      // const projects = state.projects;

      console.log("Inside add project reducer action");
      // console.log(action.project);
      console.log(state.projects);
      // console.log({ projects: [...state.projects, action.project] });
      return projects.concat(action.project);
    case "LOAD_PROJECTS":
      // console.log({ projects: projects.concat(action.projects) });
      return projects.concat(action.projects);
    case "EDIT_PROJECT":
      return state;
    case "DELETE_PROJECT":
      return state;
    case "ADD_BUG_TO_PROJECT":
      return state;
    case "REMOVE_BUG_FROM_PROJECT":
      return state;
    case "SET_ACTIVE_PROJECT":
      return state;
    default:
      return state;
  }
}

export default projectsReducer;
